const fs = require('fs');
const {
  GoogleGenAI,
} = require ('@google/genai');

const dotenv = require('dotenv');
dotenv.config();

async function run(image) {
  const ai = new GoogleGenAI({
    apiKey: process.env.GEMINI_API_KEY,
  });
  const config = {
    responseMimeType: 'text/plain',
    systemInstruction: [
        {
          text: `"You are an image evaluation AI. Analyze each input image and return whether it is relevant to the domain of real-world locations that are dirty or need maintenance.

Mark the image as relevant only if:

It is a real, non-AI-generated image, and

It shows waste, garbage, pollution, or visibly dirty environments that require cleaning or maintenance.

For all other images—including clean places, AI-generated visuals, or unrelated content—mark them as not relevant.

Your response must be in the exact JSON format below, with only true or false`,
        }
    ],
  };
  const model = 'gemini-2.0-flash';
  const contents = [
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/webp`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": false
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/jpeg`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": true
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/jpeg`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": true
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/webp`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": false
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          inlineData: {
            data: ``,
            mimeType: `image/webp`,
          },
        },
      ],
    },
    {
      role: 'model',
      parts: [
        {
          text: `\`\`\`json
{
  "relevant": false
}
\`\`\``,
        },
      ],
    },
    {
      role: 'user',
      parts: [
        {
          text: image,
        },
      ],
    },
  ];

  const response = await ai.models.generateContentStream({
    model,
    config,
    contents,
  });
  let fileIndex = 0;
  let text = ""
  for await (const chunk of response) {
    console.log(chunk.text);
    text += chunk.text;
  }

  return text;
}

// main();


const image = fs.readFileSync("./1w.webp", { encoding: "base64" });
console.log(run(image))
module.exports = run;
